import React, { PureComponent } from 'react'
import {
    BarChart,
    Bar,
    XAxis,
    YAxis,
    CartesianGrid,
    Tooltip,
    Legend,
    ResponsiveContainer,
} from 'recharts'

const data = [
    { name: 'count', value: 27 },
    { name: 'min', value: 131 },
    { name: 'avg', value: 12217 },
